import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import { ProtectedRoute } from "../routes/ProtectedRoute";
import SignUp from "../Components/SignUp";
import Login from "./../Components/Login";
import Table from "./../Components/Table";
import Header from "../Components/Header";
import { Categories } from "../Components/Categories";
import Chat from "../Components/Chat";
import Slider from "../Components/Slider";
import Video from "../Components/Video";
import Reviews from "../Components/Reviews";
import Footer from "../Components/Footer";
import Products from "../DB/products.json";
import Headphones from "../Components/Headphones";
import Headphone from "../Components/Headphone";

const index = () => (
  <div className="App">
    <Header />
    {/* <Login /> */}
    <Chat />
    <Slider />
    <Video />
    <Reviews />
    <Footer />
  </div>
);
const explore = () => (
  <div className="explore">
    <Header />
    <Categories />
    <Footer />
  </div>
);
const headphones = () => (
  <div className="headphones">
    <Header />
    <Categories />
    <Headphones items={Products.HEADPHONES} />
  </div>
);
// const headphone = () => (
//   <div>
//     <Header />
//     <Categories />
//     <Headphone id={headphoneId} />
//   </div>
// );

// const login = () => (
//   <div>
//     <Header />
//     <Login />
//   </div>
// );

// const admin = () => (
//   <div className="App">
//     <Table />
//   </div>
// );

const AppRouter = props => (
  <BrowserRouter>
    <div className="App">
      <Switch>
        <Route path="/" render={index} exact />
        <Route path="/categories" render={explore} />
        <Route path="/headphones" render={headphones} />
        {/* <Route path="/headphone/:headphoneId" render={headphone} /> */}
        {/* <Route path="/login" component={login} /> */}
        {/* <Route path="/search" component={admin} /> */}
      </Switch>
    </div>
  </BrowserRouter>
);

export default AppRouter;
